    top: 1.5%;
    left: 0%;
    position: relative;
    opacity: 0;
    z-index: 2;
    cursor: grab;
}

.faceBabylon:active {
    cursor: grabbing;
}

.faceBabylonCanvas, .picOrbitCanvas, .connect3DCanvas {
    margin: 0%;
    top: 0%;
    left: 0%;
    width: 100%;
    height: 100%;
    position: relative;
    outline: none;
    -webkit-tap-highlight-color: rgba(255, 255, 255, 0);
}

section {
    position: absolute;
    top: 0%;
    width: 100%;
    height: 100vh;
    overflow: hidden;
    box-sizing: border-box;
    justify-content: center;
    transition-duration: .2s;
}

section .titleTextBox {
    position: absolute;
    top: 0%;
    left: 0%;
    width: 100%;
    height: 100vh;
    overflow: hidden;
    background: linear-gradient(90deg, black, silver);
    clip-path: circle(23% at 50% 50%);
}

section h2,
section .titleTextBox h2 {
    position: absolute;
    color: black;
    display: inline-block;
    font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;
    font-size: 9vw;
